    <header><nav><a href="/index.html">Minh Ton</a> <a href="/projects.html">Projects</a> <a href="/services/web/index.html">Web Development Services</a></nav></header><main><section><h1>Facebook Account Marketplace</h1><p>1.5 months | Solo Project | Completed<p>Developed a full-stack Facebook Account Marketplace with secure user authentication, integrated payment system, and admin dashboard. Includes account purchasing, order tracking, and user balance management.</p><a href="https://hieuvia.com"rel="noopener noreferrer"target="_blank">View Live Project</a> <a href="/services/web/index.html">Contact to build a similar website</a></section><section><h2>Project Overview</h2><p>I developed this project from the ground up using ASP.NET Core Razor Pages, focusing on modularity, security, and scalability.<p>The system was structured with a clean separation between user and admin roles, incorporating secure authentication, dynamic role-based routing, and custom middleware for access control.<p>I integrated Payos QR-based payments, implemented an automated system to check live Facebook account status, and ensured real-time stock updates for accurate availability, for bulk operations and performance optimization, I utilized multithreading techniques for features like ordering/importing multiple Facebook accounts.<p>The admin tools were designed to streamline account management with bulk actions, status checks, and data exports.</section><section><h2>Key Features</h2><ul><li>User authentication and authorization<li>Order multiple Facebook accounts at once<li>Order tracking and history<li>Auto Check Live Facebook Account<li>Personal balance tracking with secure QR payments via PayOS<li>Advanced account list management with search, filters, pagination, delete, and export options<li>Flexible discount code system for sales and promotions<li>Clipboard copy and file export of Facebook account lists<li>User data management</ul></section><section><h2>Challenges & Solutions</h2><h3>Challenge: Ensuring live account availability</h3><p>Ensuring only live Facebook accounts are sold and automatically updating account availability when status changes.<p><strong>Solution:</strong> Implemented a system that auto-checks Facebook account live status and updates the stock in real time to maintain accurate availability.<h3>Challenge: Bulk account processing</h3><p>Handling the upload and processing of large volumes of Facebook accounts efficiently.<p><strong>Solution:</strong> Utilized multithreading techniques to optimize bulk account import, significantly reducing upload time and improving system responsiveness.<h3>Challenge: Secure payment integration</h3><p>Integrating seamless online payments while maintaining secure and trackable personal balances.<p><strong>Solution:</strong> Integrated PayOS QR code payment API to enable secure balance top-ups and transaction tracking within user accounts.<h3>Challenge: User interface customization</h3><p>Designing a user interface tailored to customer-specific requirements and preferences.<p><strong>Solution:</strong> Maintained close communication with the customer and continuously refined the UI design based on their feedback to ensure satisfaction.<h3>Challenge: Account list management</h3><p>Providing a smooth experience for users to manage and export large lists of purchased accounts.<p><strong>Solution:</strong> Built advanced account list tools with pagination, filtering, copying, and exporting (as text/file) to enhance usability and efficiency.<h3>Challenge: Server security and performance</h3><p>Direct access to the VPS exposed its real IP address, making it vulnerable to DDoS attacks and other malicious traffic.<p>The server experienced performance drops during high traffic due to lack of traffic filtering.<p>Misconfigured Cloudflare rules initially caused false positives, blocking some legitimate users.<p><strong>Solution:</strong> Enabled Cloudflare’s Full Proxy mode to completely mask the origin server IP. Set up Firewall Rules and Page Rules in Cloudflare to block known bots, limit request rates, and challenge suspicious traffic. Monitored real-time traffic via Cloudflare analytics to fine-tune the protection.<h3>Challenge: Spam and duplicate orders</h3><p>The process also risked being spammed via repeated submissions, potentially causing duplicate orders or draining inventory.<p>In rare edge cases, if a server crash occurred mid-transaction, users could become stuck in an "ordering" state, blocking them from future purchases.<p><strong>Solution:</strong> Enforced a one-order-at-a-time rule: users cannot initiate a new purchase while one is being processed, effectively eliminating spam attempts or rapid double-clicking. Introduced an automated recovery task that runs every default minutes, scanning and resetting users who have been in the ordering state for over default minutes — resolving any cases where the process was interrupted (e.g. server crash or unexpected failure). Added fallback logic that uses a fresh database context when updates to user state fail, increasing fault tolerance and ensuring consistency even under failure conditions.<h3>Challenge: Concurrency issues</h3><p>The account purchase system faced concurrency issues when multiple users attempted to buy accounts at the same time, risking data conflicts and accidental double-selling of the same account.<p><strong>Solution:</strong> Implemented a robust concurrency-control strategy using per-user locking combined with transaction scopes and isolated DbContext instances to ensure safe parallel order processing.</section><section><h2>Project Highlights</h2><p><strong>Achieved faster order processing</strong>: Reduced account order before 500 from 1m59s optimize to 10s after more optimize I reached 1000 acc to 1s using sql, multithreading optimization.</p><img alt="Highlight optimize"src="/imgs/fb_marketplace/order-before-opt.webp"> <img alt="Highlight optimize"src="/imgs/fb_marketplace/order-after-opt.webp"> <img alt="Highlight optimize"src="/imgs/fb_marketplace/order-after-opt(1).webp"><p><strong>Solved concurrency issues</strong>: Implemented scoped transactions and isolated DbContext per request to avoid race conditions when multiple users purchase simultaneously. Added auto-recovery after default mins to reset stuck orders.<p><strong>Prevented spam abuse</strong>: Built a mechanism using ordering state to prevent spam by blocking repeated or fast double-purchase attempts. Ensures smoother UX and protects inventory integrity.<p><strong>Enhanced security with Cloudflare</strong>: Deployed to VPS with Cloudflare to mask server IP and mitigate DDoS attacks, ensuring higher availability and security.<p><strong>Built intelligent real-time automation</strong>: Built automated system to check Facebook account status and update stock in real-time, improving accuracy and admin efficiency.<p><strong>Empowered users with advanced data control</strong>: Improved user control over large datasets with flexible viewing and export options.<p><strong>Integrated secure payment processing</strong>: Provided users with a reliable and traceable payment method inside the platform.</section><section><h2>Project Info</h2><p>Category: Web Application<p>My Role: Full-Stack Developer<p>Duration: 1.5 months<p>Team Size: Solo Project<p>Technologies: ASP.NET Core Razor Pages, Entity Framework Core, Html, Css, Js, SQL Server, Payos, Cloudflare, IIS<p>Quick Stats: Dev Time: 4 weeks, Features: 20+, User Roles: Admin / User, Payment: PayOS QR, Built By: 100% Solo, Responsive: ✅, Deployed: ✅</section><section><h2>Related Projects</h2><p><a href="/webs/robux-marketplace.html">Robux Marketplace</a>: Website<p><a href="/webs/labroom.html">Academic Lab Management System</a>: Website</section><section><h2>Project Images</h2><ul><li><img alt="Screenshot home page"src="/imgs/fb_marketplace/homepage.webp"><li><img alt="Screenshot products showcase"src="/imgs/fb_marketplace/homepage(1).webp"><li><img alt="Screenshot Personal Wallet"src="/imgs/fb_marketplace/balance.webp"><li><img alt="Screenshot Product Management Page"src="/imgs/fb_marketplace/fbaccount-management.webp"><li><img alt="Screenshot Concurrency Buying Demo"src="/imgs/fb_marketplace/homepage-2user.webp"></ul></section></main><footer><h3>Tôn Thất Phu Nhật Minh</h3><nav><a href="/index.html">Home</a> <a href="/index.html#about">About</a> <a href="/index.html#skills">Skills</a> <a href="/projects.html">Projects</a> <a href="/index.html#contacts">Contacts</a></nav><p>Email: <a href="mailto:contact@minhton.dev">contact@minhton.dev</a><p>Phone: <a href="https://zalo.me/0915682176">+84 915682176</a><p>Location: <a href="https://maps.app.goo.gl/DMbT3amH4Zozn8jY9">Ho Chi Minh City, Việt Nam</a><p>Social: <a href="https://www.youtube.com/@IkuraIsCoding">YouTube</a> | <a href="https://www.facebook.com/TTPNMinh/">Facebook</a> | <a href="https://github.com/IkMinhTon">GitHub</a> | <a href="https://www.tiktok.com/@ikuraiscoding">TikTok</a><p>© June 17, 2025 Minh Ton – All Rights Reserved.</footer>
